ger/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mfussenegger/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mfussenegger/subscriptions', 'organizations_url': 'https://api.github.com/users/mfussenegger/orgs', 'repos_url': 'https://api.github.com/users/mfussenegger/repos', 'events_url': 'https://api.github.com/users/mfussenegger/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mfussenegger/received_events', 'type': 'User', 'site_admin': False}, 'body': "In both the signature help and in the completion resolve path ad-hoc
cached ThreadPool instances were created and not shutdown properly.

Using the same ExecutorService instance can avoid spawning new threads,
which is cheaper than re-creating new threads all time. A quick
benchmark:

		ExecutorsBenchmark.createAdhocThreadPool          avgt   10  124.947 ± 1.527  us/op
		ExecutorsBenchmark.reuseThreadPool                avgt   10   14.979 ± 1.234  us/op

But more importantly the instances weren't shutdown after use, leaking
